import './FileUpload.css'
import FileUploadIcon from '@mui/icons-material/FileUpload';

function FileUpload() {
  return (
    <div className="upload__container">
      <button className="upload__btn"><FileUploadIcon />Upload</button>
    </div>
  )
}

export default FileUpload;
